import {BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom'
import About from './components/About';
import Home from './components/Home';

//import About from './components/About';
function App() {
    return (
    <>
     <Navbar/>
     <Routes>

      <Route path='/' element={<Home/>} />
      <Route path='/about' element={<About/>} />
      </Routes>
    </>
    )
  }
export default App;
